import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';

function Header({ categories, onSelect }) {
  return (
    <Navbar bg="dark" variant="dark" expand="lg">
      <Container>
        <Navbar.Brand href="#">Algo Explorer</Navbar.Brand>
        <Navbar.Toggle aria-controls="algo-navbar-nav" />
        <Navbar.Collapse id="algo-navbar-nav">
          <Nav className="me-auto">
            {Object.entries(categories).map(([group, items]) => (
              <NavDropdown key={group} title={group} id={`nav-dropdown-${group}`}>
                {items.map((algo) => (
                  <NavDropdown.Item key={algo} onClick={() => onSelect(algo)}>
                    {algo}
                  </NavDropdown.Item>
                ))}
              </NavDropdown>
            ))}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
